// Import Libraries
import React, { useState } from 'react';
import Header from './header';
import Footer from './footer';
import './App.css';
import List from './list';
import Top from './Top';


// Create component
const App = () => {
  const [state, setState] = useState(10);

  const increase = () => {
    setState(count => count + 1);
  };

  const decrease = () => {
    setState(count => count - 1);
  };

  return (
    <div className="App">
      {/* Tombol Tambah & Kurang dipindah ke atas Header */}
      <button onClick={increase}>Tambah</button>
      <br />
      <span>{state}</span>
      <br />
      <button onClick={decrease}>Kurang</button>

      {/* Komponen lainnya */}
      <h1>Hello React</h1>
      <Header list="10 daftar makanan " />
      <Top />
      <List />
      <Footer />
    </div>
  );

};

// Export Default
export default App;
